import axios from "axios"

export const fetchSearchData = (searchText) => {
    const url = 'https://api-r1.tagalys.com/v1/search?';
    const options = {
        method: 'POST',
        params: {
            q: 'tops',
            page: '1'
        },
        Body: {

            'client_code': '92D5626DBFD74912',
            'api_key': '5dff8cbc1c833937d5b6ff490de6639b',
            'store_id': '77435339050',
        }
    };

    const response = axios.request(url, options);
    console.log(response);
}
